import React from "react";

function openInNewTab(url) {
  var win = window.open(url, '_blank');
  win.focus();
}

const Titles = () => (
  <div>
    <h1 className = "title-container__title"> National Park Kiosk </h1>
    <h3 className = "title-container__subtitle"> Everything you want to know, consolidated for ease of access! </h3>
    <h5 className = "title-container__subtitle"> To start searching, check out the list of park codes below</h5>
    <h6 onclick="openInNewTab('www.test.com');">Something To Click On</h6>
  </div>
);

export default Titles;
